import React from 'react';
import classes from "./NewsForm.module.css";
const NewsForm = ({ setVisible }) => {
    async function AddNews(e){
        e.preventDefault();

        setVisible(false);
    }
    return (
        <form className={classes.newsForm}>
            <input placeholder='Title' required/>
            <input placeholder='Summary' required/>
            <textarea placeholder='Main part' required></textarea>
            <button onClick={AddNews}>Add</button>
        </form>
    );
};

export default NewsForm;
